    <div className="carrinho-container">
      <h2>Carrinho</h2>
      {Array.isArray(foodOptions) && foodOptions.length > 0 ? (
        <ul>
          {foodOptions.map((option, index) => (
            <li key={index}>{option.title}</li>
          ))}
        </ul>
